import React from "react";
import logo from "./logo.svg";
import "./App.css";
import FullName2 from "./FullName2";
import SoftDev from "./SoftDev";

function App() {
  return (
    <div className="App">
      <div className="name-wrapper">
        <div className="accounts">
          <div className="account-holder">
            <img src="https://freecodecampassets.s3.us-east-2.amazonaws.com/Portfolio+Assets+1/iconfinder_github-social-media_765246.png"></img>
          </div>
          <div className="account-holder">
            <img src="https://freecodecampassets.s3.us-east-2.amazonaws.com/Portfolio+Assets+1/iconfinder_linkedin_777926.png"></img>
          </div>

          <div className="account-holder">
            <img src="https://freecodecampassets.s3.us-east-2.amazonaws.com/Portfolio+Assets+1/fcc_primary_small.png"></img>
          </div>
        </div>
        <div className="tape-holder">
          <FullName2 />
          <SoftDev />
        </div>
        <ul className="link-wrapper">
          <li className="link">PROJECTS</li>
          <li className="link">ABOUT</li>
          <li className="link">CONTACT</li>
          <li className="link">RESUME</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
